import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableOpacity, RefreshControl } from 'react-native';
import Icon from 'react-native-vector-icons/MaterialIcons';
import { useAuth } from '../context/AuthContext';
import axios from 'axios';

const HomeScreen = ({ navigation }) => {
  const { user } = useAuth();
  const [stats, setStats] = useState({
    totalAnalyses: 0, completedAnalyses: 0, processingAnalyses: 0, totalPatients: 0
  });
  const [recentAnalyses, setRecentAnalyses] = useState([]);
  const [refreshing, setRefreshing] = useState(false);

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      const [statsResponse, analysesResponse] = await Promise.all([
        axios.get('/users/stats'),
        axios.get('/analysis/recent')
      ]);

      setStats(statsResponse.data);
      setRecentAnalyses(analysesResponse.data);
    } catch (error) {
      console.error('Error loading dashboard:', error);
    }
  };

  const onRefresh = async () => {
    setRefreshing(true);
    await loadDashboardData();
    setRefreshing(false);
  };

  const StatCard = ({ title, value, icon, color, onPress }) => (
    <TouchableOpacity style={[styles.statCard, { borderLeftColor: color }]} onPress={onPress}>
      <View style={styles.statContent}>
        <View>
          <Text style={styles.statValue}>{value}</Text>
          <Text style={styles.statTitle}>{title}</Text>
        </View>
        <Icon name={icon} size={32} color={color} />
      </View>
    </TouchableOpacity>
  );

  return (
    <ScrollView 
      style={styles.container}
      refreshControl={<RefreshControl refreshing={refreshing} onRefresh={onRefresh} />}
    >
      <View style={styles.header}>
        <View>
          <Text style={styles.greeting}>Olá, {user?.name}</Text>
          <Text style={styles.subtitle}>CRM {user?.crm}</Text>
        </View>
        <TouchableOpacity style={styles.profileButton} onPress={() => navigation.navigate('Profile')}>
          <Icon name="account-circle" size={40} color="#1E3A8A" />
        </TouchableOpacity>
      </View>

      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Quick Summary</Text>

        <View style={styles.statsGrid}>
          <StatCard title="Análises" value={stats.totalAnalyses} icon="analytics" color="#3B82F6" onPress={() => navigation.navigate('Analysis')} />
          <StatCard title="Histórico EYA" value={stats.completedAnalyses} icon="history" color="#10B981" />
          <StatCard title="Clinical Tip" value="30 min" icon="schedule" color="#F59E0B" />
          <StatCard title="Pacientes" value={stats.totalPatients} icon="people" color="#8B5CF6" onPress={() => navigation.navigate('Patients')} />
        </View>
      </View>

      <TouchableOpacity style={styles.newAnalysisButton} onPress={() => navigation.navigate('Analysis')}>
        <Icon name="add" size={24} color="white" />
        <Text style={styles.newAnalysisText}>Nova Análise</Text>
      </TouchableOpacity>

      <View style={styles.section}>
        <Text style={styles.sectionTitle}>Análises Recentes</Text>
        {recentAnalyses.map((analysis) => (
          <TouchableOpacity key={analysis.id} style={styles.analysisCard}>
            <View style={styles.analysisHeader}>
              <Text style={styles.analysisTitle}>{analysis.title}</Text>
              <Text style={styles.analysisDate}>{new Date(analysis.createdAt).toLocaleDateString('pt-BR')}</Text>
            </View>
            <Text style={styles.patientName}>{analysis.Patient?.name}</Text>
            <View style={styles.analysisFooter}>
              <View style={[styles.statusBadge, { backgroundColor: analysis.status === 'completed' ? '#10B981' : '#F59E0B' }]}>
                <Text style={styles.statusText}>{analysis.status === 'completed' ? 'Concluída' : 'Processando'}</Text>
              </View>
              {analysis.aiConfidenceScore && (
                <Text style={styles.confidenceScore}>{Math.round(analysis.aiConfidenceScore * 100)}% confiança</Text>
              )}
            </View>
          </TouchableOpacity>
        ))}
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1, backgroundColor: '#F9FAFB' },
  header: { flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', padding: 20, backgroundColor: 'white', borderBottomWidth: 1, borderBottomColor: '#E5E7EB' },
  greeting: { fontSize: 20, fontWeight: 'bold', color: '#1F2937' },
  subtitle: { fontSize: 14, color: '#6B7280', marginTop: 2 },
  profileButton: { padding: 4 },
  section: { padding: 20 },
  sectionTitle: { fontSize: 18, fontWeight: '600', color: '#1F2937', marginBottom: 16 },
  statsGrid: { flexDirection: 'row', flexWrap: 'wrap', justifyContent: 'space-between' },
  statCard: { backgroundColor: 'white', borderRadius: 12, padding: 16, width: '48%', marginBottom: 12, borderLeftWidth: 4, shadowColor: '#000', shadowOffset: { width: 0, height: 2 }, shadowOpacity: 0.1, shadowRadius: 4, elevation: 3 },
  statContent: { flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center' },
  statValue: { fontSize: 24, fontWeight: 'bold', color: '#1F2937' },
  statTitle: { fontSize: 12, color: '#6B7280', marginTop: 4 },
  newAnalysisButton: { backgroundColor: '#1E3A8A', flexDirection: 'row', alignItems: 'center', justifyContent: 'center', borderRadius: 12, padding: 16, marginHorizontal: 20, marginBottom: 10 },
  newAnalysisText: { color: 'white', fontSize: 16, fontWeight: '600', marginLeft: 8 },
  analysisCard: { backgroundColor: 'white', borderRadius: 12, padding: 16, marginBottom: 12, shadowColor: '#000', shadowOffset: { width: 0, height: 2 }, shadowOpacity: 0.1, shadowRadius: 4, elevation: 3 },
  analysisHeader: { flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', marginBottom: 8 },
  analysisTitle: { fontSize: 16, fontWeight: '600', color: '#1F2937', flex: 1 },
  analysisDate: { fontSize: 12, color: '#6B7280' },
  patientName: { fontSize: 14, color: '#6B7280', marginBottom: 12 },
  analysisFooter: { flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center' },
  statusBadge: { paddingHorizontal: 8, paddingVertical: 4, borderRadius: 12 },
  statusText: { color: 'white', fontSize: 12, fontWeight: '600' },
  confidenceScore: { fontSize: 12, color: '#6B7280' }
});

export default HomeScreen;
